import { Paper } from '@mui/material';
import Box from '@mui/material/Box';

export const RegisterPage = () => {
    return (
        <>
            <Box
                sx={{

                    height: "100vh",
                    background: "blue"
                }}
            >
                <Paper elevation={3}>
                    sx={{
                        height: "400px",
                        background: "red",
                    }}
                </Paper>
            </Box>
        </>
    )
};
